export default function Friends({ initialFriends }) {
  return (
    <ul>
      {initialFriends.map((f) => (
        <FriendItem friend={f} key={f.id} />
      ))}
    </ul>
  );
}

function FriendItem({ friend }) {
  return (
    <li>
      <img src={friend.image} alt={friend.image}></img>
      <h3>{friend.name}</h3>
      <button className="button">Select</button>
    </li>
  );
}
